import React from "react";

class Form extends React.Component {
  render(){
    return (
      <div>
        <h3>Add a book</h3>
        <form>
          Title: <input type = "text" placeholder = "Book title" value = "" name = "title" />
          <br></br>
          Image: <input type = "text" placeholder = "Image url" value = "" name = "img" />
        </form>
      </div>
    )
  }
}

export default Form;
